v8:item.v8:content:
Данный параметр показывает известно ли достоверно, что банку нужно дополнительное подтверждение авторизации OTP кодом из СМС
Возможные значения:
Пусто (пустая ячейка) - достоверно не известно;
1 - банк НЕ требует дополнительное подтверждение авторизации OTP кодом из СМС;
2 - банк требует дополнительное подтверждение авторизации OTP кодом из СМС.
